const lightFoot = new LightFootClientSDK({
  OTLPExporterBaseURL: "http://localhost:5173",
  tracesBaseUrl: "http://localhost:4318/",
  propagateTraceHeaderCorsUrls: ["http://localhost:4318/"]
});

